import React from 'react';
import {Route} from 'react-router-dom';

import CollectionOveview from '../../components/collection-overview/collection-overview.component';
import CategoryPage from '../collection/collection.component';


const ShopPage = ({match}) => (
    <div className='shop-page'>
        <Route exact path={`${match.path}`} component={CollectionOveview } />
        <Route path={`${match.path}/:collectionId`} componen={CategoryPage} />
    </div>
);


export default ShopPage;
